import React from "react";

class ProjectList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <h1>Project List Component</h1>
      </div>
    );
  }
} //END OF CLASS

export default ProjectList;
